objetoCompra:
O curso pretende oferecer aos participantes do Conselho os seguintes objetivos:

Entender os conceitos e a importância da governança de TI para as organizações;
Diferenciar governança de TI de governança corporativa;
Diferenciar Governança de TI da Gestão de TI;
Conhecer o básico dos principais modelos como COBIT, ITIL e ISO/IEC 38.500:2019;
Saber a abordagem que o TCU faz para acompanhar a Governança de TI nos órgãos federais e nos órgãos do poder judiciário (iGovTIC);
Utilizar essas boas práticas para melhorar a gestão de TI nas organizações;
Alinhar a estratégia de TI com os objetivos de negócios;
Desenvolver e implementar um planejamento estratégico eficaz para a TI;
Saber o papel dos comitês de TI na governança das instituições públicas;
Conhecer a importância os recursos humanos na área de TI;
Criar e implementar políticas e procedimentos de TI que suportem a governança.

Apresentação de exemplos práticos de casos sobre contratações de TIC nas diversas fases do processo
 O conteúdo programático, anexo a este processo, será distribuído em 4 dias de curso, sendo de 4 dias, com carga horária de 20 horas de capacitação, no formato 100% on -line.
